    image: `${process.env.PUBLIC_URL}/image/products/product1.PNG`,
    short: "Enhances wheat yield with balanced nutrients.",
  },
  {
    id: 2,
    name: "Paddy Guard",
    category: "Pesticide",
    image: `${process.env.PUBLIC_URL}/image/products/product2.PNG`,
    short: "Protects rice crops from insects and fungus.",
  },
  {
    id: 3,
    name: "Organic Compost",
    category: "Soil Improver",
    image: `${process.env.PUBLIC_URL}/image/products/product3.PNG`,
    short: "100% organic compost to improve soil fertility.",
  },
];


export default products;
